import React from 'react';
import style from './Project.module.css';

const Project = (props) => {

    return(
        <div className={style.item}>
            <div>
                Название проекта
                <img className={style.folder} src="https://cdn2.iconfinder.com/data/icons/file-and-folder-26/64/folder-document-archive-interface-512.png" alt="folder"/>
            </div>
        </div>
    );
};

export default Project;
